def find_max(lst):
    i = 0
    max = 0
    max_index = -1
    for i in range(len(lst)):
        if lst[i] > max:
            max = lst[i]
            max_index = i
    return max_index

def find_sum(lst, k):
    sum = 0
    i = 0
    while i in range(len(lst)):
        if k != i:
            sum += lst[i]
        i += 1
    return sum
